import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SimpleCalculatorService {
  constructor(private http: HttpClient) {
  }

  add(start: number, amount: number) {
    let response = this.http.request('GET', `https://localhost:7136/api/add?start={start}&amount={amount}`, { responseType: 'json' });
    console.log(response);

//    this.http.get()
//      .subscribe(response => {
//        console.log(response.json());
//      });
    return start + amount;
  }

  subtract(start: number, amount: number) {
    return start - amount;
  }
}
